import React from 'react';
import { Link } from 'react-router-dom';
import notfound from '../../images/404.png';

const NotFound = () => {
    return (
        <div>
        <img className="w-100" src={notfound} alt=""/>
        <Link to="/">
        <button>Go Back</button>
        </Link>
        </div>
    );
};

export default NotFound;
